import React, { Component } from "react";
import BrainTemplate from "../assets/images/brain-template.svg";
import BrainParts from "../assets/images/brain-parts.svg";

class Skills extends Component {
  render() {
    return (
      <div className="skills">
        <h1>SKILLS</h1>
        <div className="brain">
          <div className="brain__template">
            <img
              className="brain__template--svg"
              src={BrainTemplate}
              alt="brain-template"
            />
          </div>
          <div className="brain__parts">
            <img className="bpsvg" src={BrainParts} alt="brain-parts" />
          </div>
        </div>
      </div>
    );
  }
}

export default Skills;
